import React from "react";
const Blog = (props) => {
  return (
    <div
      className="bg-dark mb-3 card text-start"
      style={{ width: "400px", height: "200px" }}
    >
      {/* <div className=" bg-dark border-4" 
    // style={{width:"400px", height: "200px" }}
    > */}
      <div className="card bg-dark text-light text-md-center">
        <div className="card-body">
          <h5 className="card-title">{props.mission}</h5>
          <p className="card-text">
            {/* With supporting text below as a natural lead-in to additional
            content. */}
            {props.description}
          </p>
        </div>
      </div>
    </div>
    // {/* </div> */}
  );
};

export default Blog;
